import React, { useState } from 'react';
import { Link } from 'react-router-dom';

import { Button, BtnTypes } from '../components';

import './ProductionPage.css';

export const ProductionPage = () => {
  const [isMenuOpened, openMenu] = useState();

	return (
    <nav className="navigation-container">
      <li className="navigation-item">
        <Link to="/"><Button text={'Назад'} type={BtnTypes.warn}/></Link>
      </li>
      <li className="navigation-item">
        <Button text={'Управление'} type={BtnTypes.primary} clicked={openMenu}/>
      </li>
    </nav>
  );
}
